import { Fragment } from "react";
import { CardTitle, Row } from "reactstrap";
import { Colxx } from "../../common/CustomBootstrap";
import IconCard from "../../forms/IconCard";
import * as TiIcons from 'react-icons/ti';



function ListUsers() {
    return (
        <Fragment>
         
            <Row style={{marginTop:20}}>
      <Colxx xxs="6">
       
        <Row className="icon-cards-row mb-2">
         
              <Colxx xxs="6" sm="4" md="3" lg="2">
                <IconCard title="utilisateurs" icon={<TiIcons.TiArrowRepeat/>} value="20" className="mb-4" />
              </Colxx>
         
        </Row>
      </Colxx>
      <Colxx xxs="6">
       
        <Row className="icon-cards-row mb-2">
         
              <Colxx xxs="6" sm="4" md="3" lg="2">
                <IconCard title="utilisateurs" icon="men" value="20" className="mb-4" />
              </Colxx>
         
        </Row>
      </Colxx>
    </Row>
        </Fragment>
    );
}
export default ListUsers;
